import List from'./List';
import React, {useState} from "react";
import './Tasks.css';

function Lists(props) {
    return (<div className={'Tasks'}>
        {props.list.map(elem => <div>
            <List id = {elem.id}/>
        </div>)}
    </div>);
}

export default Lists;
